(15, 'No disponible', 'Secretaría General', 'Secretaría General', 'Técnico', '2013.I.0006', 'ALMA ZULEMA TOVAR FIGUEROA', 'DIRECTORA DE GESTIÓN DOCUMENTAL', 'MC2', 'Internacional', 'No disponible', 'IFAI/SG/044/2013', 'México', 'Distrito Federal', 'Ciudad de México', 'Colombia', 'Bogotá', 'Cundinamarca', '450', 'USD', 'Capacitación y Cultura de la Transparencia', 'Recibir capacitación', 'CURSAR EL SEGUNDO SEMESTRE DE LA MAESTRIA DE GESTION DOCUMENTAL Y ADMINISTRACION DE ARCHIVOS', 'No disponible', 'CURSAR EL SEGUNDO SEMESTRE DE LA MAESTRIA DE GESTION DOCUMENTAL Y ADMINISTRACION DE ARCHIVOS; QUE SE IMPARTE EN LA UNIVERSIDAD DE LA SALLE; EN LA CIUDAD DE BOGOTA; COLOMBIA; EN EL MARCO DEL CONVENIO DE APORTACION DE RECURSOS QUE CELEBRAN EL CONSEJO NACIONAL DE CIENCIA Y TECNOLOGIA "CONACYT" Y EL ARCHIVO GENERAL DE LA NACION "AGN".', 'No disponible', 'En seguimiento a/ plan de estudio; se anexa copla del horario de c/ases; por lo anterior y con el propósito de brindar mayor información respecto de las mismas; a continuación\nse señalan los principales temas que comprende cada materia:\n\n\nIDENTIFICACION Y VALORACION DOCUMENTAL. La impartición  de la materia busca plantear una apreciación técnica de los documentos ; partiendo de principios y criterios de valoración que conlleven a la determinación de una metodología que posibilite determinar el valor de los distintos documentos en el ciclo de vida; independiente mente del media en el que se encuentran ya sean físicos; magnéticos 6 electrónicos; procurando determinar en la valoración; no s61o un elemento como un activo econ6mico y de valor administrativo; sino también como un bien cultural; patrimonial y un documento hist6rico.\n\nFORMULACION Y CONTROL DE PROYECTOS\n\nDebido a la relevancia de los elementos que ofrecen un esquema estructura lo metodol6gico para asumir los retos en la program', 'No disponible', 'Se efectuó satisfactoriamente la fase presencial de la capacitación en "Gestión Documental y Administración de Archivos"; reforzando los conocimientos en dicha materia. Se participó en su totalidad en las lecciones correspondientes al programa; las cuales permitieron adquirir al participante; nuevos conocimientos para resolver las problemáticas en cuanto a la gestión documental y el manejo de sus archivos; desde un enfoque tridimensional implementando la gestión de los proyectos archivísticos; las tecnologías de la información y la gestión documental; lo cual; le permitirá al participante emprender acciones y estrategias en breve plazo en el Instituto para optimizar el Archivo de Concentración y Archivos de Trámite; de conformidad con las nuevas disposiciones de la Ley Federal de Archivos\n', 'No disponible', 'IFAI', 'Aéreo', 'Avianca', 'AV 23', 'Avianca', 'AV 72', 11594, 0, 11594, 'IFAI', 'Hotel Boutique Alma', '03/03/2013', '3/16/2013', '03/03/2013', '3/16/2013', '03/03/2013', '3/15/2013', 'No disponible', 0, 0, 0, 'No aplica', 75, '19.4326077', '-99.133208', '4.61666', '-74.09996'),
